import React, {useEffect} from 'react';
import Loader from '../UI/Loader/Loader';
import Projects from './Projects';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFolderOpen } from '@fortawesome/free-solid-svg-icons';

export const MyProjects = (props) => {

  useEffect(() => {
    if (props.myProjects === undefined || props.myProjects.success === undefined)
      props.getUserProjects();    
  })

  if (props.myProjects !== undefined && props.myProjects.data !== undefined && props.myProjects.data.length !== 0) {
    return (
      <Projects 
        projectsList={props.myProjects.data}
        deleteUserProject={props.deleteUserProject}
        onDeleteProject={props.onDeleteProject}
        onRemoveUserInProject={props.onRemoveUserInProject}
        openAddUserInProjectForm={props.openAddUserInProjectForm}
      />
    );
  } else if (props.myProjects !== undefined && props.myProjects.success !== undefined) {
    return <div className="empty">Проектов пока нет <b>:(</b> <FontAwesomeIcon icon={faFolderOpen} /></div>;
  } else {
    return <Loader />;
  } 
}

export default MyProjects;
